function Burgers({title, price, weight, image}) {
    return (
        <div className="burger">
            <img src="./images/burger1.jpg" alt="" />
            <div className="info">
                <p className='info_price'>{price}₽</p>
                <p className='food_name'>{title}</p>
                <p className='info_weight'>{weight}г</p>
            </div>
            <button className='add'>Добавить</button>
        </div>
    )
}

export default Burgers;
